At Xxxxxx Xxxxx, we strive to provide the highest quality pharmacy, health, and retail services at fair and competitive prices in our communities; to serve and satisfy the needs of our customers; to be responsive to the needs and goals of our employees; to manage our company's resources to insure a fair and equitable return on investment for our stockholders; and to plan and provide for the continued growth of Xxxxxx Xxxxx.

We believe:

Our services and our products must exceed the expectations of our customers;
The people of Xxxxxx Xxxxx are our most valuable asset;
We are only as strong as our community and we should each strive to make our community a better place to live;
Outstanding financial performance helps us to accomplish our broader mission and preserve private company ownership;
We are guided by our own values - those of excellence, the ethical and moral responsibilities placed upon us, and our community spirit;
These beliefs and values guide our business strategies, our corporate behaviors and our relationships with customers, communities, each other and our suppliers.
